import { Button, Drawer, List, ListItemButton, ListItemText, Typography } from "@mui/material"
import { useState } from "react"

function Sidebar() {
    const [open,setOpen]=useState(false)
    const courses=['reactjs','expressjs','nodejs','html','css','javascript','mongodb']
  return (
    <>
    <Typography variant='h4' sx={{margin:'10px', textAlign:'center'}}>container with propert maxwidth</Typography>

    <Button onClick={()=>setOpen(true)}>sidebar</Button>

    <Drawer open={open} onClose={()=>setOpen(false)}>
        <List>
            {
                courses.map((courses)=>(
                    <ListItemButton  onClick={()=>setOpen(false)}>
                        <ListItemText primary={courses} />
                    </ListItemButton>
                ))
            }
        </List>
    </Drawer>
      
    </>
  )
}

export default Sidebar
